				description:
					'Met ingang van 1 september 1941 mochten joodse kinderen slechts scholen bezoeken die uitsluitend voor joodse leerlingen waren bestemd. In alle delen van het land werden scholen voor joodse leerlingen opgericht. Aan deze scholen mochten alleen joodse docenten worden aangesteld. In Den Haag werd op 15 oktober 1941 het Joods Lyceum in de Fisherstraat 135 geopend. Dit Joods Lyceum bleef bestaan tot 26 november 1942, waarna de school onder de naam Joodse School voor Voortgezet Onderwijs werd verplaatst naar de Bezemstraat. De school bleef bestaan tot 15 april 1943.\r\nBarend Koekoek was van 1 maart 1943 tot 15 april 1943 als docent verbonden aan het Joods Lyceum voor het vak aardrijkskunde.',
