				address: 'Laan Copes van Cattenburg 129',
				description:
					'Herman Salomonson had in Delft gestudeerd. Tijdens de Eerste Wereldoorlog schreef hij gedichten onder het pseudoniem Melis Stoke. Hij was reserve kapitein. In de oorlogsdagen van mei 1940 diende hij bij het Centraal Luchtmachtbureau in Den Haag, waar hij luchtwachtberichten omriep.\r\n\r\nHerman Salomonson was journalist en directeur van het persbureau Aneta, ondergebracht in het gebouw van het ANP in Den Haag. Onmiddellijk na de capitulatie werd hij uit zijn ambt gezet en mocht hij het gebouw niet meer binnen.\r\n\r\nHerman Salomonson verspreidde illegaal door hem geschreven gedichten. Hij is op 24 oktober 1940 gepakt en via de gevangenis van Scheveningen (waar hij nog gedichten schreef), Amersfoort en Buchenwald naar Mauthausen op transport gesteld, waar hij is doodgeschoten.',
